package dosktop

import (
	"github.com/supercom32/dosktop/internal/memory"
	"github.com/stretchr/testify/assert"
	"testing"
)

// 80x64 image
var sampleBase64Image string = ""

func TestImageLoading(test *testing.T) {
	commonResource.isDebugEnabled = true
	layerWidth := 100
	layerHeight := 35
	InitializeTerminal(layerWidth, layerHeight)
	LoadBase64Image(sampleBase64Image, "sampleImage")
	obtainedValue, _:= getBase64PngFromImage(memory.GetImage("sampleImage").ImageData)
	expectedValue := sampleBase64Image
	assert.Equalf(test, expectedValue, obtainedValue ,"The decoded and encoded image does not match!")
}

func TestDrawBadImagesToLayer(test  *testing.T) {
	defer func() {
		if r := recover(); r == nil {
			test.Errorf("Drawing an image to a layer with an invalid layer should have thrown a panic!")
		}
	}()
	commonResource.isDebugEnabled = true
	layerWidth := 100
	layerHeight := 35
	InitializeTerminal(layerWidth, layerHeight)
	DrawImageToLayer("Bad Layer", "sampleImage", 1, 1, 0, 0, 0)
}

func TestDrawScalableImageToLayer(test *testing.T) {
	commonResource.isDebugEnabled = true
	layerAlias1 := "Layer1"
	layerWidth := 100
	layerHeight := 35
	InitializeTerminal(layerWidth, layerHeight)
	AddLayer(layerAlias1, 0, 0, layerWidth, layerHeight, 1, "")
	Layer(layerAlias1)
	Color(4, 6)
	FillLayer(layerAlias1, "a1a2a3a4a5")
	LoadPreRenderedBase64Image(sampleBase64Image, "sampleImage", 80, 32, 0)
	DrawImageToLayer(layerAlias1, "sampleImage", 1, 1, 0, 0, 0)
	UpdateDisplay()
	layerEntry := commonResource.screenLayer
	obtainedValue := layerEntry.GetBasicAnsiStringAsBase64()
	expectedValue := ""
	assert.Equalf(test, expectedValue, obtainedValue ,"The updated screen does not match the master original!")
}